import{_ as a,a as o,b as i}from"./chunks/pixhack_v5_debug.DSQ3pqGM.js";import{_ as l,c as n,j as e,a as s,G as d,a8 as p,B as c,o as u}from"./chunks/framework.BDnHobkS.js";const y=JSON.parse('{"title":"CUAV v5 (Discontinued)","description":"","frontmatter":{},"headers":[],"relativePath":"en/flight_controller/cuav_v5.md","filePath":"en/flight_controller/cuav_v5.md"}'),h={name:"en/flight_controller/cuav_v5.md"};function m(g,t,b,f,v,P){const r=c("Badge");return u(),n("div",null,[t[0]||(t[0]=e("h1",{id:"cuav-v5-discontinued",tabindex:"-1"},[s("CUAV v5 (Discontinued) "),e("a",{class:"header-anchor",href:"#cuav-v5-discontinued","aria-label":'Permalink to "CUAV v5 (Discontinued)"'},"​")],-1)),d(r,{type:"info",text:"Discontinued"}),t[1]||(t[1]=p('<div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This flight controller has been <a href="./../flight_controller/autopilot_experimental.html">discontinued</a> and is no longer commercially available.</p></div><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p><em>CUAV v5</em><sup>®</sup> (previously &quot;Pixhack v5&quot;) is an advanced autopilot designed and made by CUAV<sup>®</sup>. The board is based on the <a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk-project</a> <strong>FMUv5</strong> open hardware design. It runs PX4 on the <a href="https://nuttx.apache.org/" target="_blank" rel="noreferrer">NuttX</a> OS, and is fully compatible with PX4 firmware. It is intended primarily for academic and commercial developers.</p><p><img src="'+a+'" alt="CUAV v5"></p><h2 id="quick-summary" tabindex="-1">Quick Summary <a class="header-anchor" href="#quick-summary" aria-label="Permalink to &quot;Quick Summary&quot;">​</a></h2><ul><li><p>Main FMU Processor: STM32F765</p><ul><li>32 Bit Arm® Cortex®-M7, 216MHz, 2MB memory, 512KB RAM</li></ul></li><li><p>IO Processor: STM32F100</p><ul><li>32 Bit Arm® Cortex®-M3, 24MHz, 8KB SRAM</li></ul></li><li><p>On-board sensors:</p><ul><li>Accelerometer/Gyroscope: ICM-20689</li><li>Accelerometer/Gyroscope: BMI055</li><li>Magnetometer: IST8310</li><li>Barometer: MS5611</li></ul></li><li><p>Interfaces:</p><ul><li>8-14 PWM outputs (6 from IO, 8 from FMU)</li><li>3 dedicated PWM/Capture inputs on FMU</li><li>Dedicated R/C input for CPPM</li><li>Dedicated R/C input for PPM and S.Bus</li><li>analog / PWM RSSI input</li><li>S.Bus servo output</li><li>5 general purpose serial ports</li><li>4 I2C ports</li><li>4 SPI buses</li><li>2 CANBuses with serial ESC</li><li>Analog inputs for voltage / current of 2 batteries</li></ul></li><li><p>Power System:</p><ul><li>Power: 4.3~5.4V</li><li>USB Input: 4.75~5.25V</li><li>Servo Rail Input: 0~36V</li></ul></li><li><p>Weight and Dimensions:</p><ul><li>Weight: 90g</li><li>Dimensions: 44x84x12mm</li></ul></li><li><p>Other Characteristics:</p><ul><li>Operating temperature: -20 ~ 80°C （Measured value）</li></ul></li></ul><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><p>Order from <a href="https://cuav.taobao.com/index.htm?spm=2013.1.w5002-16371268426.2.411f26d9E18eAz" target="_blank" rel="noreferrer">CUAV</a>.</p><h2 id="connection" tabindex="-1">Connection <a class="header-anchor" href="#connection" aria-label="Permalink to &quot;Connection&quot;">​</a></h2><p><img src="'+o+'" alt="CUAV v5"></p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The RCIN interface is limited to powering the rc receiver and cannot be connected to any power/load.</p></div><h2 id="voltage-ratings" tabindex="-1">Voltage Ratings <a class="header-anchor" href="#voltage-ratings" aria-label="Permalink to &quot;Voltage Ratings&quot;">​</a></h2><p><em>CUAV v5</em> can be triple-redundant on the power supply if three power sources are supplied. The three power rails are: <strong>POWER1</strong>, <strong>POWER2</strong> and <strong>USB</strong>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The output power rails <strong>FMU PWM OUT</strong> and <strong>I/O PWM OUT</strong> (0V to 36V) do not power the flight controller board (and are not powered by it). You must supply power to one of <strong>POWER1</strong>, <strong>POWER2</strong> or <strong>USB</strong> or the board will be unpowered.</p></div><p><strong>Normal Operation Maximum Ratings</strong></p><p>Under these conditions all power sources will be used in this order to power the system:</p><ol><li><strong>POWER1</strong> and <strong>POWER2</strong> inputs (4.3V to 5.4V)</li><li><strong>USB</strong> input (4.75V to 5.25V)</li></ol><h2 id="building-firmware" tabindex="-1">Building Firmware <a class="header-anchor" href="#building-firmware" aria-label="Permalink to &quot;Building Firmware&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make px4_fmu-v5_default</span></span></code></pre></div><h2 id="debug-port" tabindex="-1">Debug Port <a class="header-anchor" href="#debug-port" aria-label="Permalink to &quot;Debug Port&quot;">​</a></h2><p>The <a href="./../debug/system_console.html">PX4 System Console</a> and <a href="./../debug/swd_debug.html">SWD interface</a> operate on the <strong>FMU Debug</strong> port. Simply connect the FTDI cable to the Debug &amp; F7 SWD connector. To access the I/O Debug port, the user must remove the CUAV v5 shell. Both ports have standard serial pins and can be connected to a standard FTDI cable (3.3V, but 5V tolerant).</p><p>The pinout is as shown.</p><p><img src="'+i+'" alt="CUAV v5 debug"></p><table tabindex="0"><thead><tr><th>pin</th><th>CUAV v5 debug</th></tr></thead><tbody><tr><td>1</td><td>GND</td></tr><tr><td>2</td><td>FMU-SWCLK</td></tr><tr><td>3</td><td>FMU-SWDIO</td></tr><tr><td>4</td><td>UART7_RX</td></tr><tr><td>5</td><td>UART7_TX</td></tr><tr><td>6</td><td>VCC</td></tr></tbody></table><h2 id="serial-port-mapping" tabindex="-1">Serial Port Mapping <a class="header-anchor" href="#serial-port-mapping" aria-label="Permalink to &quot;Serial Port Mapping&quot;">​</a></h2><table tabindex="0"><thead><tr><th>UART</th><th>Device</th><th>Port</th></tr></thead><tbody><tr><td>UART1</td><td>/dev/ttyS0</td><td>GPS</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM1 (flow control)</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>TELEM2 (flow control)</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>TELEM4</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>TX is RC input from SBUS_RC connector</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>Debug Console</td></tr><tr><td>UART8</td><td>/dev/ttyS6</td><td>PX4IO</td></tr></tbody></table><h2 id="peripherals" tabindex="-1">Peripherals <a class="header-anchor" href="#peripherals" aria-label="Permalink to &quot;Peripherals&quot;">​</a></h2><ul><li><a href="https://item.taobao.com/item.htm?spm=a1z10.3-c-s.w4002-16371268452.37.6d9f48afsFgGZI&amp;id=9512463037" target="_blank" rel="noreferrer">Digital Airspeed Sensor</a></li><li><a href="https://cuav.taobao.com/category-158480951.htm?spm=2013.1.w5002-16371268426.4.410b7a821qYbBq&amp;search=y&amp;catName=%CA%FD%B4%AB%B5%E7%CC%A8" target="_blank" rel="noreferrer">Telemetry Radio Modules</a></li><li><a href="./../sensor/rangefinders.html">Rangefinders/Distance sensors</a></li></ul><h2 id="supported-platforms-airframes" tabindex="-1">Supported Platforms / Airframes <a class="header-anchor" href="#supported-platforms-airframes" aria-label="Permalink to &quot;Supported Platforms / Airframes&quot;">​</a></h2><p>Any multicopter / airplane / rover or boat that can be controlled with normal RC servos or Futaba S-Bus servos. The complete set of supported configurations can be seen in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><h2 id="further-info" tabindex="-1">Further info <a class="header-anchor" href="#further-info" aria-label="Permalink to &quot;Further info&quot;">​</a></h2><ul><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 reference design pinout</a>.</li><li><a href="http://doc.cuav.net/flight-controller/v5-autopilot/en/v5.html" target="_blank" rel="noreferrer">CUAV v5 docs</a></li><li><a href="https://github.com/cuav" target="_blank" rel="noreferrer">CUAV Github</a></li></ul>',34))])}const w=l(h,[["render",m]]);export{y as __pageData,w as default};
